import './App.css';

function App() {
    return (
        <div className="App">
            <header id="header">Header</header>
            <div id="sidebar-left">Left</div>
            <div id="main">Main</div>
            <div id="sidebar-right">Right</div>
            <div id="footer">Footer</div>
        </div>
    );
}

export default App;
